import React from "react";
import { Link } from "react-router-dom";
// import HomePage from "../../Pages/HomePage";


function List(props) { 
   //  const listLinks = props.links.map((link, index)  => <li key={index}><Link to={`../../Pages/${link}`}>{link}</Link></li>); 
   //  const listLinks = props.links.map((link, index)  => <li key={index}>{link}</li>); 
    return (<ul className={props.styleNew} >
     <li><Link to='/home'>Home</Link></li>
     <li><Link to='/sobre'>Sobre</Link></li>
     <li><Link to='/projetos'></Link></li>
     <li><Link to='/habilidade'></Link></li>
     <li><Link to='/contatos'></Link></li>
   </ul>)
   //  return (<ul className={props.styleNew} >
   //    {listLinks}
   // </ul>)
}

export default List;
